                {/*//         <h2 className="popup__result_text">Вы успешно зарегистрировались!</h2>*/}
                {/*//     </div>*/}
                {/*// </>*/}
                {/*}*/}

            </div>
        </div>
    )
}

export default InfoTooltip;
